INSERT INTO `zt_chart`(`id`,`name`,`dimension`,`type`,`group`,`dataset`,`desc`,`settings`,`filters`,`fields`,`sql`,`builtin`,`objects`,`createdBy`,`createdDate`,`editedBy`,`editedDate`,`deleted`) VALUES ('1079','年度新增-任务年度新增和完成趋势图','1','line','0','','','{
