INSERT INTO `zt_chart`(`id`,`name`,`dimension`,`type`,`group`,`dataset`,`desc`,`settings`,`filters`,`fields`,`sql`,`builtin`,`objects`,`createdBy`,`createdDate`,`editedBy`,`editedDate`,`deleted`) VALUES ('1081','年度新增-执行年度新增和完成趋势图','1','line','0','','','{
  \"xaxis\":[{\"field\":\"month\",\"name\":\"月份\",\"group\":\"value\"}],
