INSERT INTO `zt_chart`(`id`,`name`,`dimension`,`type`,`group`,`dataset`,`desc`,`settings`,`filters`,`fields`,`sql`,`builtin`,`objects`,`createdBy`,`createdDate`,`editedBy`,`editedDate`,`deleted`) VALUES ('1082','年度新增-产品发布次数年度趋势图','1','line','0','','','{
  \"xaxis\":[{\"field\":\"month\",\"name\":\"月份\",\"group\":\"value\"}],
  \"yaxis\":[{\"type\":\"value\",\"field\":\"release\",\"agg\":\"value\",\"name\":\"发布次数\",\"valOrAgg\":\"value\"}
]}','','','SELECT t1.year, CONCAT(t1.month, \'月\') AS `month`, IFNULL(t2.release, 0) AS `release`
FROM (SELECT DISTINCT Year(date) AS `year`, MONTH(date) AS `month` FROM zt_action) AS t1
LEFT JOIN (SELECT YEAR(createdDate) AS `year`, MONTH(createdDate) AS `month`, COUNT(1) AS `release` FROM zt_release WHERE deleted = \'0\' GROUP BY `year`, `month`) AS t2 ON t1.year = t2.year AND t1.month = t2.month
ORDER BY `year`, t1.month','1','','','0000-00-00 00:00:00','','0000-00-00 00:00:00','0');
INSERT INTO `zt_chart`(`id`,`name`,`dimension`,`type`,`group`,`dataset`,`desc`,`settings`,`filters`,`fields`,`sql`,`builtin`,`objects`,`createdBy`,`createdDate`,`editedBy`,`editedDate`,`deleted`) VALUES ('1083','年度新增-年度投入产出比','1','line','0','','','{
  \"xaxis\":[{\"field\":\"month\",\"name\":\"月份\",\"group\":\"value\"}],
  \"yaxis\":[{\"type\":\"value\",\"field\":\"ratio\",\"agg\":\"value\",\"name\":\"投入产出比\",\"valOrAgg\":\"value\"},
{\"type\":\"value\",\"field\":\"story\",\"agg\":\"value\",\"name\":\"需求交付\",\"valOrAgg\":\"value\"},
{\"type\":\"value\",\"field\":\"consumed\",\"agg\":\"value\",\"name\":\"工时消耗\",\"valOrAgg\":\"value\"}
]}','','','SELECT t1.`year`, CONCAT(t1.`month`, \'月\') AS `month`, IFNULL(t2.story, 0) AS story, IFNULL(t3.consumed, 0) AS consumed, ROUND(IF(IFNULL(t3.consumed, 0) = 0, 0, IFNULL(t2.story, 0) / IFNULL(t3.consumed, 0)), 2) AS ratio
FROM (SELECT YEAR(`date`) AS \'year\', MONTH(`date`) AS \'month\' FROM zt_action GROUP BY `year`,`month`) AS t1
LEFT JOIN (SELECT ROUND(SUM(estimate)) AS story, YEAR(`closedDate`) AS \'year\', MONTH(`closedDate`) AS \'month\' FROM zt_story WHERE deleted = \'0\' AND closedReason = \'done\' AND status = \'closed\' GROUP BY `year`,`month`) AS t2 ON t1.`year` = t2.`year` AND t1.`month` = t2.`month`
LEFT JOIN (SELECT ROUND(SUM(consumed)) as consumed, YEAR(`date`) as \'year\', MONTH(`date`) AS \'month\' FROM zt_effort WHERE deleted = \'0\' GROUP BY `year`,`month`) AS t3 ON t1.`year` = t3.`year` AND t1.`month` = t3.`month`','1','','','0000-00-00 00:00:00','','0000-00-00 00:00:00','0');
INSERT INTO `zt_chart`(`id`,`name`,`dimension`,`type`,`group`,`dataset`,`desc`,`settings`,`filters`,`fields`,`sql`,`builtin`,`objects`,`createdBy`,`createdDate`,`editedBy`,`editedDate`,`deleted`) VALUES ('1085','年度排行-项目集-预算投入榜','1','bar','0','','','{\"xaxis\":[{\"field\":\"program\",\"name\":\"项目集\"}],\"yaxis\":[{\"type\":\"value\",\"field\":\"budget\",\"agg\":\"value\",\"name\":\"预算\",\"valOrAgg\":\"value\"}]}','','','SELECT 
  YEAR(t2.openedDate) AS `year`, 
  t1.id,
  t1.name AS program, 
  ROUND(
    SUM(
      IFNULL(t2.budget, 0)
    ) / 10000, 
    2
  ) AS budget 
FROM 
  zt_project AS t1 
  LEFT JOIN zt_project AS t2 ON FIND_IN_SET(t1.id, t2.path) 
  AND t2.deleted = \'0\' 
  AND t2.type = \'project\' 
WHERE 
  t1.deleted = \'0\' 
  AND t1.type = \'program\' 
  AND t1.grade = 1 
GROUP BY 
  `year`, 
  id,
  program 
ORDER BY 
  `year`, 
  budget DESC','1','','','0000-00-00 00:00:00','','0000-00-00 00:00:00','0');
INSERT INTO `zt_chart`(`id`,`name`,`dimension`,`type`,`group`,`dataset`,`desc`,`settings`,`filters`,`fields`,`sql`,`builtin`,`objects`,`createdBy`,`createdDate`,`editedBy`,`editedDate`,`deleted`) VALUES ('1086','年度排行-项目集-人员投入榜','1','bar','0','','','{\"xaxis\":[{\"field\":\"setName\",\"name\":\"项目集\"}],\"yaxis\":[{\"type\":\"value\",\"field\":\"number\",\"agg\":\"value\",\"name\":\"人数\",\"valOrAgg\":\"value\"}]}','','','SELECT tt.join as `year`, count(1) as number, tt.setName from (
select 
YEAR(t1.join) as `join`, t4.name as setName 
from zt_team t1 
RIGHT JOIN zt_project t2 on t2.id = t1.root
LEFT JOIN zt_project t4 on FIND_IN_SET(t4.id,t2.path) and t4.grade = 1
RIGHT JOIN zt_user t3 on t3.account = t1.account
WHERE t1.type = \'project\'
AND t2.deleted = \'0\'
AND t3.deleted = \'0\'
) tt
GROUP BY tt.setName, tt.join
ORDER BY tt.join, number desc, tt.setName','1','','','0000-00-00 00:00:00','','0000-00-00 00:00:00','0');
INSERT INTO `zt_chart`(`id`,`name`,`dimension`,`type`,`group`,`dataset`,`desc`,`settings`,`filters`,`fields`,`sql`,`builtin`,`objects`,`createdBy`,`createdDate`,`editedBy`,`editedDate`,`deleted`) VALUES ('1087','年度排行-项目集-工时消耗榜','1','bar','0','','','{\"xaxis\":[{\"field\":\"program\",\"name\":\"项目集\"}],\"yaxis\":[{\"type\":\"value\",\"field\":\"consumed\",\"agg\":\"value\",\"name\":\"消耗工时\",\"valOrAgg\":\"value\"}]}','','','SELECT 
  YEAR(t5.date) AS `year`, 
  t1.id,
  t1.name AS program, 
  ROUND(
    SUM(t5.consumed), 
    2
  ) AS consumed 
FROM 
  zt_project AS t1 
  LEFT JOIN zt_project AS t2 ON FIND_IN_SET(t1.id, t2.path) 
  AND t2.deleted = \'0\' 
  AND t2.type = \'project\' 
  LEFT JOIN zt_project AS t3 ON t2.id = t3.parent 
  AND t3.deleted = \'0\' 
  AND t3.type IN (\'sprint\', \'stage\', \'kanban\') 
  LEFT JOIN zt_task AS t4 ON t3.id = t4.execution 
  AND t4.deleted = \'0\' 
  AND t4.status != \'cancel\' 
  LEFT JOIN zt_effort AS t5 ON t4.id = t5.objectID 
  AND t5.deleted = \'0\' 
  AND t5.objectType = \'task\' 
WHERE 
  t1.deleted = \'0\' 
  AND t1.type = \'program\' 
  AND t1.grade = 1 
  AND t5.id IS NOT NULL 
GROUP BY 
  `year`, 
  id,
  program 
ORDER BY 
  `year`, 
  consumed DESC','1','','','0000-00-00 00:00:00','','0000-00-00 00:00:00','0');
