INSERT INTO `zt_chart`(`id`,`name`,`dimension`,`type`,`group`,`dataset`,`desc`,`settings`,`filters`,`fields`,`sql`,`builtin`,`objects`,`createdBy`,`createdDate`,`editedBy`,`editedDate`,`deleted`) VALUES ('1099','年度排行-项目-完成需求条目榜','1','bar','0','','','{\"xaxis\":[{\"field\":\"project\",\"name\":\"项目\"}],\"yaxis\":[{\"type\":\"value\",\"field\":\"story\",\"agg\":\"value\",\"name\":\"完成需求条目\",\"valOrAgg\":\"value\"}]}','','','SELECT 
