LEFT JOIN zt_bug AS t2 ON t1.id = t2.product AND t2.deleted = \'0\'
WHERE t1.deleted = \'0\' AND t1.shadow = \'0\' AND t1.vision = \'rnd\' AND t2.id IS NOT NULL
