YEAR(t3.openedDate) AS `year`,t2.realname,count(1) AS count
FROM zt_action AS t1 RIGHT JOIN zt_user AS t2 ON t1.actor=t2.account LEFT JOIN zt_bug AS t3 ON t1.objectID=t3.id
WHERE t1.objectType=\'bug\' AND t1.action=\'opened\' AND t3.deleted=\'0\'
GROUP BY `year`,t2.account ORDER BY `year`,count DESC','1','','','0000-00-00 00:00:00','','0000-00-00 00:00:00','0');
INSERT INTO `zt_chart`(`id`,`name`,`dimension`,`type`,`group`,`dataset`,`desc`,`settings`,`filters`,`fields`,`sql`,`builtin`,`objects`,`createdBy`,`createdDate`,`editedBy`,`editedDate`,`deleted`) VALUES ('1108','年度排行-个人-修复Bug条目榜','1','bar','0','','','{\"xaxis\":[{\"field\":\"realname\",\"name\":\"用户\"}],\"yaxis\":[{\"type\":\"value\",\"field\":\"count\",\"agg\":\"value\",\"name\":\"修复Bug条目\",\"valOrAgg\":\"value\"}]}','','','SELECT 
YEAR(t3.openedDate) AS `year`,t2.realname,count(DISTINCT t3.id) AS count
FROM zt_action AS t1 RIGHT JOIN zt_user AS t2 ON t1.actor=t2.account LEFT JOIN zt_bug AS t3 ON t1.objectID=t3.id
